import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../context/AuthContext';
import './Naglowek.css';

const Naglowek = () => {
  const { user, logout } = useContext(AuthContext);

  const handleLogout = async () => {
    await logout();
  };

  return (
    <nav className="navbar">
      <h1><Link to="/">Braid Hair Glamour</Link></h1>
      <ul>
        {user ? (
          <>
            <li><Link to="/konto">Moje Konto</Link></li>
            {user.role === 'admin' && (
              <>
                <li><Link to="/rezerwacje">Lista Rezerwacji</Link></li>
                <li><Link to="/wiadomosci">Wszystkie Wiadomości</Link></li>
              </>
            )}
            {user.role !== 'admin' && (
              <>
                <li><Link to="/rezerwacje">Zarezerwuj Wizytę</Link></li>
                <li><Link to="/wiadomosci">Moje Wiadomości</Link></li>
              </>
            )}
            <li><button onClick={handleLogout}>Wyloguj się</button></li>
          </>
        ) : (
          <li><Link to="/">Logowanie/Rejestracja</Link></li>
        )}
      </ul>
    </nav>
  );
};

export default Naglowek;
